import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import {
  Container, AppBar, Button, Toolbar, Typography, Stack,
} from '@mui/material';
import ArrowBackIosIcon from '@mui/icons-material/ArrowBackIos';

export default function Post() {
  const { group_id } = useParams();
  return (
    <AppBar
      className="postbar"
      position="static"
      sx={{
        bgcolor: 'background.paper',
        boxShadow: 0,
        borderRadius: 2,
        p: 2,
        minWidth: 300,
      }}
    >
      <Toolbar>
        <Button variant="text" color="secondary">Back to Activity Feed</Button>
        <Stack direction="row" spacing={6}>
          <Button color="inherit" sx={{ color: 'black' }}>Activity Feed</Button>
          <Button color="inherit" sx={{ color: 'black' }}>Chat Room</Button>
          <Button color="inherit" sx={{ color: 'black' }}>My History</Button>
          <Button color="inherit" sx={{ color: '#0096FF' }}>Create Post</Button>
          <Button color="inherit" sx={{ color: 'white', backgroundColor: '#EA3C3C' }}>My Profile</Button>
        </Stack>
      </Toolbar>
    </AppBar>
  );
}
